import React from 'react'
import './Delivery.sass'
import {Title} from '../../../components'

function Delivery() {
	return (
		<div className='delivery'>
			<Title title='Доставка блюд' subtitle='Дуже швидка доставка' light style={{textAlign:'left'}}/>
		</div>
	)
}

export default Delivery
